import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    location: ['대시보드', '충전인프라 관리', '충전기 상태 및 제어', '충전기 상태'],
    statusLists: [
      { name: '끊김', number: 1},
      { name: '대기', number: 12},
      { name: '준비', number: 99},
      { name: '예약', number: 1},
      { name: '충전', number: 9},
      { name: '종료', number: 1},
      { name: '고장', number: 1},
    ],
  },
  getters: {
  },
  mutations: {
  },
  actions: {
  },
  modules: {
  }
})
